const PLANES_ENDPOINT = 'https://crudcrud.com/api/f7686985d04f4829aa92005efc85d8f1/houses';

class PlanesApi {
    get = async () => {
        try {
            const resp = await fetch(PLANES_ENDPOINT);
            const data = await resp.json();
            return data;
        } catch(e) {
            console.log('Oops, looks like fetchPlanes had an issue.', e);
        }
    }

    put = async (plane) => {
        try {

            const resp = await fetch(`${PLANES_ENDPOINT}/${plane._id}`, {
                method: 'PUT',
                headers: {
                    'Content-type': 'application/json'
                },
                body: JSON.stringify(plane)
            });
            return await resp.json();
        } catch(e) {
            console.log('Oops, looks like updating planes had an issue.', e);
        }
    }
}

export const planesApi = new HousesApi();
